import React from 'react';
import './Ourstats.css';
import CountUp from 'react-countup';

function Ourstats() {
  return (
    <div className='stats-container'>
        <div> <CountUp end={80} duration={5} suffix={"+ members"} /> + members</div>
        <div> <CountUp end={1000} duration={5} /> + memories created</div>
        <div> <CountUp end={1} duration={3} /> commuinity made</div>
    </div>  
  )
}

export default Ourstats
